script: |
  super -f text -I q19.spq | sort > q19.out

inputs:
  - name: q19.spq
    data: |
      SELECT DISTINCT 50 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT ( + col0 / col1 ) NOT BETWEEN col2 * + col0 * - col0 AND + + col1 + 90 + 61;
  - name: tab0

outputs:
  - name: q19.out
    data: |
      50
